import React from "react";
import axios from "axios";
import { useEffect } from "react";
export default function UserProfilePage() {
  const url = "http://localhost:5000/api/users/6190c6fbb62fa29cba2b1322";
  let user;
  const getData = () => {
    axios({
      method: "GET",
      url: url,
      data: {},
    })
      .then((res) => {
        user = res.data.result._id;
        console.log(user);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  // getData();
  useEffect(() => {
    getData();
  }, []);

  return(
    <>
    <h1></h1>
    
    </>
  )
}
